import plus from './plus.png';
import './Sidebar.css';
import { useState } from 'react';

export default function Sidebar() {
    const [sidebarOpen, toggleSidebar] = useState(false);
    const [showPlus, togglePlus] = useState(true);

    return (
        <div className="sidebar">
            <div className="closed-sidebar">
                <img className="plusIcon" src={plus} alt='plus' onClick={() => toggleSidebar(!sidebarOpen)}></img>
            </div>
            {sidebarOpen && <div>hello world</div>}            
        </div>
    )
}
